window.bookSummaryJSON = "<p>Protected. Hidden. Resilient. Three lives entwined.</p> <p>A friend lost in the past, a frightened child in the present, a future that is one gigantic freaking dumpster fire of a calamity.</p> <p>And Kaitlyn and Magnus must keep hope alive when yet again the future demands their attention and possibly their lives.</p> <p>“You’re going to keep me safe, Magnus?”</p> <p>“Aye, every day of m’life, Kaitlyn.”</p> <p>A blend of contemporary, historical, fantasy, and SciFi, <i>Again My Love</i> is the ninth book in the Kaitlyn and the Highlander series.</p> <p>If you love mysterious, sexy, hunky heroes with desperate hearts and romantic thoughts, heroines with courage who are also very ordinary disasters, and love stories that encompass all time, then you’ll love this romantic series. Listen as Kaitlyn and Magnus protect their family by picking up a copy of this book today.</p>"; 
